import React from "react";
import styled from "styled-components";

function Notification() {
  return (
    <div>
      <NotiParent>
        <p class="bi bi-bell-fill"></p>
        <NotiChild>1</NotiChild>
      </NotiParent>
    </div>
  );
}

export default Notification;

const NotiParent = styled.span`
  position: relative;
  cursor: pointer;
  font-size: 1.2rem;
`;

const NotiChild = styled.span`
  position: absolute;
  top: -20px;
  right: -20px;

  font-size: 1rem;
  background-color: red;
  color: white;
  padding: 3px;
  border-radius: 3px;
`;
